PREFIX snomed: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#snomed:SNOMED-CT>
SELECT DISTINCT ?first ?last WHERE {
?subject a snomed:CarePlan;
snomed:has_component ?has_component.
?has_component a snomed:CarePlan_Activity;
snomed:participant ?participant.?participant a snomed:CarePlan_Activity_participant;
snomed:hasPatient ?patient.
?patient a snomed:Patient;
snomed:identifier ?identifier.
?identifier snomed:has_concept ?has_concept.
?has_concept a snomed:Concept;
snomed:has_definition ?has_definition.
?has_definition pl:value ?first_name.
?patient snomed:hasFamilyName ?hasFamilyName.
?hasFamilyName pl:value ?last_name.
?has_concept snomed:has_code ?has_code.
?has_code snomed:code ?code;
snomed:display_name ?display_name.
FILTER (?code = '698360004').
}

